import React from 'react';

function MyPage() {
  return (
    <div style={{ padding: '40px' }}>
      <h1>마이페이지</h1>
      <p>여기에 유저 정보를 보여줄 수 있습니다.</p>
    </div>
  );
}

export default MyPage;
